    fun solveOne(s: String) = s.toInt()
    fun solveTwo(p: String, q: String) = solveOne(p) + solveOne(q)
    fun solveThree(p: String,q: String,s: String)  = when (p,q,s) {
        ("") -> -1
        ("?") -> -1
            else -> solveOne(p) * 10 + solveOne(q)+ solveOne(s)
    }

}

